import './App.css';
import Login from './components/Login/Login';
import OverView from './components/OverView/OverView';
import { Route, Routes } from "react-router-dom";


function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/' Component={Login} />
        <Route path='/home' Component={OverView} />
      </Routes>
    </div>
  );
}

export default App;
